description:
Renowned architect, Sarah Nettleton explains her process working with clients, to design and build a dream home. Her process and aesthetic are unique, what she calls a, &quot;green aesthetic&quot;. Her homes are built for the clients, needs and desires for a simpler life. Reducing redundant rooms and features, creating a sustainable home.

